s.x:
var $bm_rt;
var shift, pg, dif, n, trimStart, randomShift;
shift = effect('Super Lines')('Time Offset');
pg = thisProperty.propertyGroup(1).propertyGroup(2).propertyIndex;
dif = sub(thisLayer.content.numProperties, pg);
n = content.numProperties;
while (n > 0) {
    if (content(n).numProperties == 4 && content(n)(2)._name == 'Contents') {
        if (content(n).content(3)._name.search('Trim Paths') != -1 && content(n).content(3).start.numKeys > 0) {
            break;
        }
    }
    n--;
}
if (n != 0) {
    trimStart = content(n).content(3).start;
    randomShift = content(pg).transform.skewAxis;
    $bm_rt = trimStart.valueAtTime(sub(time, mul(sum(randomShift, mul(shift, dif)), thisComp.frameDuration)));
} else {
    $bm_rt = err__No_animated_trimPath_in_the_Layer;
}

